&quot;An elite alpha like me is getting auctioned!?&quot;

One day, Isegaya was asked to prepare an Omega from the hotel where he worked, for entertainment purposes. When he called out to the Omega who was at the meeting place, it happened to be a different Omega. However, in an unexpected turn of events, he ended up spending the night with the Omega (Sei).

Isegaya, who was supposed to be an Alpha, realised he took the initiative and was given obedience training. In the end, he ends up participating in an Alpha auction...!?

Gem Makina, a senior student in the light of the day, is actually an illegal maker of love potions when hid under the veil of obscurity. One day, she discovers an unnamed book in the forbidden section of the library. As Gem experiments with a recipe for a &quot;genuine&quot; love potion, it turns out that what she created was not a love potion, but a fairy of love!

&quot;The love potion is an interconnected string of chains in the galaxy, people always tend to have a suitable match for themselves.&quot;

A year later, Gem Makina, who has become a well known matchmaker and pharmacist in the royal palace, is commissioned by the King to find a suitable match for the youngest prince, Capere. But there's a big problem with this handsome man. It's even more serious than being weak, fickle, and cheap.

&quot;Well, he's strange&quot;
&quot;Anyone would say that he's strange&quot;
&quot;Not that. There's no thread of fate.&quot;

Alicia reincarnated into another world based on her beloved BL short novel, and her path to romance begins&hellip;! 

&quot;Until we graduate, become mine. Or even If I do this&mdash;&mdash;&quot; 

Princess Alicia hates the idea of a political marriage, so her mother offers her an alternative crossdress and enter the boys-only magic academy, and choose one of the suitors to be her fianc&eacute;! Though it sounds impossible, Alicia fell in love with Lucius, an incredibly handsome gentleman who isn&rsquo;t even a potential suitor. Yet somehow, Lucius knew right away that Alicia was a girl, and stole a kiss!

Aoi has been living with Sagara-san, his mother's ex-employee, for thirteen years. He has been harboring unrequited love for his brother for the longest time and left home because of it. They have a rule against interfering with each other, but when Sagara went out to meet up with girls&hellip;

[b][u]Polish / Polski:[/u][/b]
[spoiler]Aoi, z powodu swojej nieodwzajemnionej miłości do brata, postanawia opuścić dom. Decyduje się zamieszkać razem z Sagarą, sporo od siebie starszym przyjacielem matki. I tak oto mija 13lat. W tym czasie obaj żyli zgodnie z zasadą, by nie wtrącać się w swoje życie. Czy tak będzie dalej? Co zrobi Aoi, kiedy przyłapie Sagarę na spotkaniu z kobietą?

From Chibi Manga:

&quot;I'm not the type of guy that like falling in love but that like bullying!&quot;

Moemi was hypnotized. She can't touch someone else than the popular Hibiku-kun. Was she hypnotized in order to become Hibiku-kun's slave?! And then it begins with sentences like &quot;Good-bye my Master&quot; or &quot;please, listen to me!&quot;

A Company President diagnosed with cancer accidentally transmigrated into a novel, and became the villainous emperor the male lead is going to kill?! On top of that, this male lead is the prince of the enemy kingdom that is being imprisoned by him at this moment&hellip; Feels like he just took a step closer to death! No way! In order to live, I must please him, but I never knew that it wasn&rsquo;t just simply hatred between us&hellip;

