[spoiler]Seorang Presiden Perusahaan yang didiagnosis menderita kanker secara tidak sengaja dipindahkan ke sebuah novel, dan menjadi kaisar jahat yang akan dibunuh oleh tokoh utama laki-laki?! Selain itu, tokoh utama ini adalah pangeran kerajaan musuh yang sedang dipenjara olehnya saat ini ... Rasanya seperti dia baru saja selangkah lebih dekat ke kematian! Tidak mungkin! Untuk hidup, aku harus menyenangkannya, tetapi aku tidak pernah tahu bahwa itu bukan hanya kebencian di antara kami ...[/spoiler]
